import Link from 'next/link';
import useSWR from 'swr';
import fetch from 'isomorphic-unfetch';

const Rockets = ({ rockets }) => {
  const { data, error } = useSWR('https://api.spacexdata.com/v3/rockets?limit=10', fetch);
  if(error) return <div>failed to load</div>
  if(!data) return <div>Loading...</div>
  return (
    <div>
      <h1>Rockets Data</h1>
      <Link href='/'>
        <button>Home</button>
      </Link>
      <div>
        {console.log(rockets)}
        {rockets && rockets.map(rocket => {
          <div key={rocket.id} style={{color: 'red', fontSize: '14px'}}>
            <Link href={`rockets/${rocket.id}`}>
              <a>{rocket.name}</a>
            </Link>            
            {rocket.description}
            ROCKETS
          </div>
        })}
      </div>
    </div>
  )
}

export async function getStaticProps(context) {
  const res = await fetch('https://api.spacexdata.com/v3/rockets?limit=10');
  const data = await res.json();
  console.log('DATA', data);
  return {
    props: {
      rockets: data
    }
  }
}

export default Rockets;
